import logo from './logo.svg';
import './App.css';

function App() {
  const title = 'welcome to the new blog';
  const likes = 50;
  const person = {
    name: 'Debs',
    age: 20,
    sport: 'rugby'
  }


  return (
    <div className="App">
      <div className="content">
        <h1>{title} <img src={logo} alt="lgo"></img></h1>
        <p>Liked {likes} times</p>
      </div>
    </div>
  );

}

export default App;
